,"SCAD 0.3313365 0.3199007 0    0    0    0    0   "]},"metadata":{},"output_type":"display_data"}],"source":["library(ISLR)\n","library(glmnet)\n","library(ncvreg)\n","library(parallel)\n","cl <- makeCluster(4)\n","x <- as.matrix(Smarket[, 2:8])\n","y <- as.numeric(Smarket$Direction) - 1 # Up=1\n","cv1 <- cv.glmnet(x, y, alpha = 1, family = \"binomial\")\n","cv2 = cv.ncvreg(x, y, penalty = \"MCP\", family = \"binomial\", max.iter=10000, cluster=cl)\n","cv3 = cv.ncvreg(x, y, penalty = \"SCAD\", family = \"binomial\", max.iter=10000, cluster=cl)\n","lasso_model <- glmnet(x, y, alpha = 1, lambda = cv1$lambda.min, family = \"binomial\")\n","mcp_model <- ncvfit(x, y, penalty = \"MCP\", lambda = cv2$lambda.min)\n","scad_model <- ncvfit(x, y, penalty = \"SCAD\", lambda = cv3$lambda.min)\n","sorted_beta = function(model, name=''){\n","    beta = model$beta[order(abs(model$beta), decreasing = TRUE)] %>% as.matrix\n","    rownames(beta) = (model$beta %>% as.matrix %>% rownames)[order(abs(model$beta), decreasing = TRUE)]\n","    if(model$penalty %>% is.null){\n","        colnames(beta) = name\n","    } else {\n","        colnames(beta) = model$penalty\n","    }\n","    return(beta %>% t)\n","}\n","sorted_beta(lasso_model, 'LASSO')\n","sorted_beta(mcp_model)\n","sorted_beta(scad_model)"]},{"cell_type":"markdown","id":"e971a1f7","metadata":{"papermill":{"duration":0.023304,"end_time":"2023-12-25T06:49:09.188047","exception":false,"start_time":"2023-12-25T06:49:09.164743","status":"completed"},"tags":[]},"source":["可见 Volume 和 Today 两个变量与股票价格有正相关关系。"]},{"cell_type":"code","execution_count":3,"id":"7eb2e798","metadata":{"execution":{"iopub.execute_input":"2023-12-25T06:49:09.238275Z","iopub.status.busy":"2023-12-25T06:49:09.236632Z","iopub.status.idle":"2023-12-25T06:49:09.262923Z","shell.execute_reply":"2023-12-25T06:49:09.26108Z"},"papermill":{"duration":0.054483,"end_time":"2023-12-25T06:49:09.265589","exception":false,"start_time":"2023-12-25T06:49:09.211106","status":"completed"},"tags":[]},"outputs":[],"source":["library(glmnet)\n","library(ncvreg)\n","set.seed(1225)\n","p <- 100\n","n <- 100\n","beta <- c(rep(1,5), rep(0.5,5), rep(0,90))\n","sim_fun <- function(rho, B=100){ # 模拟次数 B\n","    MSE_lasso <- MSE_mcp <- MSE_scad <- rep(0,B)\n","    for (k in 1:B) {\n","        correlation <- matrix(0, nrow = p, ncol = p)\n","        for (i in 1:p) {\n","            for (j in 1:p) {\n","                correlation[i, j] <- rho ^ abs(i - j)  # 0.1、0.5、0.9对应的相关系数\n","            }\n","        }\n","        X <- mvrnorm(n, mu=rep(0,p), correlation)\n","        eps <- rnorm(n)\n","        Y <- X %*% beta + eps\n","        fit_lasso <- cv.glmnet(X, Y, alpha=1)\n","        lasso_coef <- coef(fit_lasso, s = fit_lasso$lambda.min)\n","        predict_data = X[, which(lasso_coef[-1] != 0)] %>% as.data.frame\n","        predicted_values = predict(lm(Y ~ ., data = predict_data), predict_data)\n","        MSE_lasso[k] = mean((Y - predicted_values)^2)\n","\n","        fit <- cv.ncvreg(X, Y, penalty = \"MCP\")\n","        coef <- coef(fit, s = fit$lambda.min)\n","        predict_data = X[, which(coef[-1] != 0)] %>% as.data.frame\n","        predicted_values = predict(lm(Y ~ ., data = predict_data), predict_data)\n","        MSE_mcp[k] = mean((Y - predicted_values)^2)\n","\n","        fit <- cv.ncvreg(X, Y, penalty = \"SCAD\")\n","        coef <- coef(fit, s = fit$lambda.min)\n","        predict_data = X[, which(coef[-1] != 0)] %>% as.data.frame\n","        predicted_values = predict(lm(Y ~ ., data = predict_data), predict_data)\n","        MSE_scad[k] = mean((Y - predicted_values)^2)\n","    }\n","    return(data.frame(lasso=mean(MSE_lasso), mcp=mean(MSE_mcp), scad=mean(MSE_scad)))\n","}"]},{"cell_type":"code","execution_count":4,"id":"ad64fc60","metadata":{"execution":{"iopub.execute_input":"2023-12-25T06:49:09.315641Z","iopub.status.busy":"2023-12-25T06:49:09.314018Z","iopub.status.idle":"2023-12-25T06:52:31.622976Z","shell.execute_reply":"2023-12-25T06:52:31.618769Z"},"papermill":{"duration":202.394847,"end_time":"2023-12-25T06:52:31.683535","exception":false,"start_time":"2023-12-25T06:49:09.288688","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 3 × 3</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>lasso</th><th scope=col>mcp</th><th scope=col>scad</th></tr>\n","\t<tr><th></th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><th scope=row>0.1</th><td>0.4297345</td><td>0.6552702</td><td>0.5256810</td></tr>\n","\t<tr><th scope=row>0.5</th><td>0.5549043</td><td>0.7385067</td><td>0.6374738</td></tr>\n","\t<tr><th scope=row>0.9</th><td>0.7473943</td><td>1.4612248</td><td>1.3838489</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A data.frame: 3 × 3\n","\\begin{tabular}{r|lll}\n","  & lasso & mcp & scad\\\\\n","  & <dbl> & <dbl> & <dbl>\\\\\n","\\hline\n","\t0.1 & 0.4297345 & 0.6552702 & 0.5256810\\\\\n","\t0.5 & 0.5549043 & 0.7385067 & 0.6374738\\\\\n","\t0.9 & 0.7473943 & 1.4612248 & 1.3838489\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A data.frame: 3 × 3\n","\n","| <!--/--> | lasso &lt;dbl&gt; | mcp &lt;dbl&gt; | scad &lt;dbl&gt; |\n","|---|---|---|---|\n","| 0.1 | 0.4297345 | 0.6552702 | 0.5256810 |\n","| 0.5 | 0.5549043 | 0.7385067 | 0.6374738 |\n","| 0.9 | 0.7473943 | 1.4612248 | 1.3838489 |\n","\n"],"text/plain":["    lasso     mcp       scad     \n","0.1 0.4297345 0.6552702 0.5256810\n","0.5 0.5549043 0.7385067 0.6374738\n","0.9 0.7473943 1.4612248 1.3838489"]},"metadata":{},"output_type":"display_data"}],"source":["rho <- c(0.1, 0.5, 0.9)\n","r1 = sim_fun(rho=0.1)\n","r2 = sim_fun(rho=0.5)\n","r3 = sim_fun(rho=0.9)\n","result = rbind(r1,r2,r3)\n","rownames(result) = rho\n","result"]},{"cell_type":"markdown","id":"10b6290e","metadata":{"papermill":{"duration":0.023218,"end_time":"2023-12-25T06:52:31.730003","exception":false,"start_time":"2023-12-25T06:52:31.706785","status":"completed"},"tags":[]},"source":["回归问题按理应当用 MSE 等评价指标，而非分类问题常用的 FNR 与 FDR。\n","\n","从上表可见，不论 rho 取什么，lasso 方法的 MSE 总是最小。"]},{"cell_type":"markdown","id":"0b57d90c","metadata":{"papermill":{"duration":0.024296,"end_time":"2023-12-25T06:52:31.777596","exception":false,"start_time":"2023-12-25T06:52:31.7533","status":"completed"},"tags":[]},"source":["课后\n","\n","---\n","\n","课上\n","\n","《数据科学》P128\n","\n","![image.png](https://s2.loli.net/2023/12/25/BXuwAIGUdQ1zqCK.png)"]},{"cell_type":"code","execution_count":5,"id":"f9cc3f51","metadata":{"execution":{"iopub.execute_input":"2023-12-25T06:52:31.828691Z","iopub.status.busy":"2023-12-25T06:52:31.827027Z","iopub.status.idle":"2023-12-25T06:52:32.228049Z","shell.execute_reply":"2023-12-25T06:52:32.225872Z"},"papermill":{"duration":0.429532,"end_time":"2023-12-25T06:52:32.230931","exception":false,"start_time":"2023-12-25T06:52:31.801399","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["0.0232505326611089"],"text/latex":["0.0232505326611089"],"text/markdown":["0.0232505326611089"],"text/plain":["[1] 0.02325053"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["0.0779265469027128"],"text/latex":["0.0779265469027128"],"text/markdown":["0.0779265469027128"],"text/plain":["[1] 0.07792655"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["0.118441422293685"],"text/latex":["0.118441422293685"],"text/markdown":["0.118441422293685"],"text/plain":["[1] 0.1184414"]},"metadata":{},"output_type":"display_data"}],"source":["library(MASS)\n","library(glmnet)\n","library(ncvreg)\n","x <- as.matrix(Boston[, -14])\n","y <- Boston$medv\n","cv1 <- cv.glmnet(x, y, alpha = 1) # lasso\n","# plot(cv1)\n","cv2 = cv.ncvreg(x, y, penalty = \"MCP\")\n","cv3 = cv.ncvreg(x, y, penalty = \"SCAD\")\n","best_lambda1 <- cv1$lambda.min\n","best_lambda2 <- cv2$lambda.min\n","best_lambda3 <- cv3$lambda.min\n","best_lambda1\n","best_lambda2\n","best_lambda3"]},{"c