acy <- mean(predicted_train == train_data$default)\n","\n","predicted_test <- ifelse(predict(model, newdata = test_data, type = \"response\") > 0.5, \"Yes\", \"No\")\n","test_accuracy <- mean(predicted_test == test_data$default)\n","\n","cat(\"训练集 预测准确率:\", train_accuracy)\n","cat(\"\\n测试集 预测准确率:\", test_accuracy)"]},{"cell_type":"code","execution_count":37,"id":"282212b2","metadata":{"execution":{"iopub.execute_input":"2023-12-25T06:53:32.593555Z","iopub.status.busy":"2023-12-25T06:53:32.591682Z","iopub.status.idle":"2023-12-25T06:53:32.835078Z","shell.execute_reply":"2023-12-25T06:53:32.830733Z"},"papermill":{"duration":0.292084,"end_time":"2023-12-25T06:53:32.839814","exception":false,"start_time":"2023-12-25T06:53:32.54773","status":"completed"},"tags":[]},"outputs":[],"source":["model_lda <- lda(default ~ student + balance + income, data = train_data)\n","pred_train_lda <- predict(model_lda, newdata = train_data)$class\n","pred_test_lda <- predict(model_lda, newdata = test_data)$class\n","accuracy_train_lda <- mean(pred_train_lda == train_data$default)\n","accuracy_test_lda <- mean(pred_test_lda == test_data$default)\n","\n","model_qda <- qda(default ~ student + balance + income, data = train_data)\n","pred_train_qda <- predict(model_qda, newdata = train_data)$class\n","pred_test_qda <- predict(model_qda, newdata = test_data)$class\n","accuracy_train_qda <- mean(pred_train_qda == train_data$default)\n","accuracy_test_qda <- mean(pred_test_qda == test_data$default)"]},{"cell_type":"code","execution_count":38,"id":"43e187c2","metadata":{"execution":{"iopub.execute_input":"2023-12-25T06:53:32.969952Z","iopub.status.busy":"2023-12-25T06:53:32.968016Z","iopub.status.idle":"2023-12-25T06:53:33.00399Z","shell.execute_reply":"2023-12-25T06:53:33.002017Z"},"papermill":{"duration":0.083083,"end_time":"2023-12-25T06:53:33.006476","exception":false,"start_time":"2023-12-25T06:53:32.923393","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream",