wYbTWePLi7ZfD3C0AcHRSyd+PSgEAToZBb7fd6VdG88c9CADw\nvwQOAAAAIHo+GQUAAACiJ3AAAAAA0RM4AAAAgOgJHAAAAED0BA4AAAAgegIHAAAAED2BAwAA\nAIiewAEAAABET+AAAAAAoidwAAAAANETOAAAAIDo/QILqIuXxFIPuQAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"height":960,"width":720}},"output_type":"display_data"}],"source":["# 8.3\n","# 实际上直接对模型 plot 就能绘制出四张检验图像\n","options(repr.plot.width = 12, repr.plot.height = 16)\n","residuals <- resid(m1)\n","fitted <- fitted(m1)\n","scatterplot <- ggplot(Auto, aes(x = horsepower, y = mpg)) +\n","  geom_point() +\n","  geom_smooth(method = \"lm\")\n","residual_plot <- ggplot() +\n","  geom_hline(yintercept = 0, linetype = \"dashed\") +\n","  geom_point(aes(x = fitted, y = residuals), color = \"blue\") +\n","  geom_smooth(aes(x = fitted, y = residuals), se = FALSE, color = \"red\", linetype = \"dashed\") +\n","  xlab(\"Fitted values\") +\n","  ylab(\"Residuals\")\n","fitted_plot <- ggplot() +\n","  geom_point(aes(x = fitted, y = Auto$mpg), color = \"blue\") +\n","  geom_smooth(aes(x = fitted, y = Auto$mpg), se = FALSE, color = \"red\", linetype = \"dashed\") +\n","  xlab(\"Fitted values\") +\n","  ylab(\"Actual values\")\n","library(cowplot)\n","plot_grid(scatterplot, residual_plot, fitted_plot, nrow = 3)"]},{"cell_type":"markdown","id":"559cc2ca","metadata":{"papermill":{"duration":0.067065,"end_time":"2023-12-25T06:53:40.527053","exception":false,"start_time":"2023-12-25T06:53:40.459988","status":"completed"},"tags":[]},"source":["1. 散点图和回归线：第一个子图是原始数据的散点图，其中 x 轴表示自变量（wt，车重量），y 轴表示因变量（mpg，每加仑英里数）。还有一条红色的回归线表示通过最小二乘法拟合得到的线性回归模型。\n","\n","2. 残差图：第二个子图是残差图，x 轴表示拟合值（fitted values），y 轴表示残差（实际观测值与模型预测值之间的差异）。这个图用来检验模型的误差项是否符合正态分布、方差齐性等假设。\n","\n","3. 拟合值图：第三个子图是拟合值图，x 轴同样表示拟合值，y 轴表示实际观测值。这个图用来检验模型的预测效果，看模型对观测数据的拟合程度如何。"]},{"cell_type":"code","execution_count":57,"id":"e8594369","metadata":{"execution":{"iopub.execute_input":"2023-12-25T06:53:40.66402Z","iopub.status.busy":"2023-12-25T06:53:40.662247Z","iopub.status.idle":"2023-12-25T06:53:48.225962Z","shell.execut