\n","# 实际上直接对模型 plot 就能绘制出四张检验图像\n","options(repr.plot.width = 16, repr.plot.height = 16)\n","library(broom)\n","diagnostics = augment(m2)\n","residual_plot <- ggplot(diagnostics, aes(x = .fitted, y = .resid)) +\n","  geom_point() +\n","  geom_hline(yintercept = 0, linetype = \"dashed\") +\n","  xlab(\"Fitted values\") +\n","  ylab(\"Residuals\") +\n","  ggtitle(\"Residual Plot\")\n","qq_plot <- ggplot(diagnostics, aes(sample = .resid)) +\n","  stat_qq() +\n","  stat_qq_line() +\n","  xlab(\"Theoretical Quantiles\") +\n","  ylab(\"Sample Quantiles\") +\n","  ggtitle(\"Q-Q Plot\")\n","scale_location_plot <- ggplot(diagnostics, aes(x = .fitted, y = abs(sqrt(abs(.std.resid))))) +\n","  geom_point() +\n","  geom_smooth(se = FALSE) +\n","  xlab(\"Fitted values\") +\n","  ylab(\"√(Standardized residuals)\") +\n","  ggtitle(\"Scale-Location Plot\")\n","cooks_distance_plot <- ggplot(diagnostics, aes(x = .hat, y = .cooksd)) +\n","  geom_point() +\n","  geom_abline(slope = 0, intercept = 4 / nrow(Auto), linetype = \"dashed\") +\n","  xlab(\"Leverage\") +\n","  ylab(\"Cook's distance\") +\n","  ggtitle(\"Cook's Distance Plot\")\n","library(gridExtra)\n","grid.arrange(residual_plot, qq_plot, scale_location_plot, cooks_distance_plot, ncol = 2)"]},{"cell_type":"markdown","id":"ccfabe5e","metadata":{"papermill":{"duration":0.083038,"end_time":"2023-12-25T06:53:50.09568","exception":false,"start_time":"2023-12-25T06:53:50.012642","status":"completed"},"tags":[]},"source":["1. 残差图（Residual Plot）：\n","   - x轴表示模型的拟合值（Fitted values）。\n","   - y轴表示残差（Residuals），即实际观测值与模型预测值之间的差异。\n","   - 每个点代表一个观测值，点的位置越偏离水平线（虚线），表示对应的残差越大。\n","   - 该图用于检查模型的误差项是否满足正态分布、方差齐性等假设。\n","\n","\n","2. Q-Q图（Quantile-Quantile Plot）：\n","   - x轴表示正态分布的理论分位数（Theoretical Quantiles）。\n","   - y轴表示观测数据的样本分位数（Sample Quantiles）。\n","   - 点位于45度对角线附近时，表示观测数据与正态分布的拟合程度较好。\n","   - 该图用于检查模型的残差是否符合正态分布假设。\n","\n","\n","3. Scale-Location图（Scale-Location Plot）：\n","   - x轴表示模型的拟合值（Fitted values）。\n","   - y轴表示标准化残差的绝对值的平方根（√(Standardized residuals)）。\n","   - 该图用于检查标准化残差是否具有相等的方差。\n","   - 若点呈现出平均水平，则表示方差齐性假设成立。\n","\n","\n","4. Cook's Distance图（Cook's Distance Plot）：\n","   - x轴表示杠杆值（Leverage），即观测值对模型拟合的影响程度。\n","   - y轴表示Cook's距离（Cook's distance），衡量了删除某个观测值后对模型参数估计的影响。\n","   - Cook's距离较大的点表示对模型拟合具有较大的影响力。\n","   - 虚线表示Cook's距离阈值，超过该阈值的点可能是影响模型拟合的离群值。"]},{"cell_type":"code","execution_count":60,"id":"b1665acf","metadata":{"execution":{"iopub.execute_input":"2023-12-25T06:53:50.264468Z","iopub.status.busy":"2023-12-25T06:53:50.262588Z","iopub.status.idle":"2023-12-25T06:53:50.77825Z","shell.execute_reply":"2023-12-25T06:53:50.77535Z"},"papermill":{"duration":0.605537,"end_time":"2023-12-25T06:53:50.783251","exception":false,"start_time":"2023-12-25T06:53:50.177714","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`geom_smooth()` using formula = 'y ~ x'\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAB4AAAAeACAIAAACgwN2RAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeXydVZ348fPcm9w0e9KmWaAr3UCxKirOiAwqa3F0hk3cBkd/Kgx0QRkUVBRh\nZBwQtG0QHRkZKyoiij8HaUFRUAcFRx1xa9MWWigkTZomzb7e5/dH5+ekLEnvzdr0/f7DF56e\nc89Xq0Y+fV7PjeI4DgAAAAAAMNYSkz0AAAAAAADTkwANAAAAAMC4EKABAAAAABgXAjQAAAAA\nAONCgAYAAAAAYFwI0AAAAAAAjAsBGgAAAACAcSFAAwAAAAAwLnIme4AMdHZ29vX1TfYUjI38\n/PwQQnd392QPAlNIMpksKioKIbS3t6fT6ckeB6aQ/Pz8OI57enomexCYQnJycgoLC4OfGvAc\nBQUFg4ODvb29kz0ITCF//qnR1tYWx/FkjwNTSGFh4cDAgJ8ao1deXv5Cv3QoBeh0Oj04ODjZ\nUzCW/IbCUFEUJRKJ4H/u4DmiKIrj2H8vYKhEIrH/p8bg4KAADUNFURT8vQYcKJlM/vnvNfzU\ngGfx9xrjzSs4AAAAAAAYFwI0AAAAAADjQoAGAAAAAGBcCNAAAAAAAIwLARoAAAAAgHEhQAMA\nAAAAMC4EaAAAAAAAxoUADQAAAADAuBCgAQAAAAAYFwI0AAAAAADjQoAGAAAAAGBcCNAAAAAA\nAIwLARoAAAAAgHEhQAMAAAAAMC4EaAAAAAAAxoUADQAAAADAuBCgAQAAAAAYFwI0AAAAAADj\nQoAGAAAAAGBcCNAAAAAAAIwLARoAAAAAgHEhQAMAAAAAMC4EaAAAAAAAxoUADQAAAADAuBCg\nAQAAAAAYFwI0AAAAAADjQoAGAAAAAGBcCNAAAAAAAIwLARoAAAAAgHEhQAMAAAAAMC4EaAAA\nAAAAxoUADQAAAADAuBCgAQAAAAAYFwI0AAAAAADjQoAGAAAAAGBcCNAAAAAAAIwLARoAAAAA\ngHEhQAMAAAAAMC4EaAAAAAAAx